import Header from "../components/Header";
import Footer from "../components/Footer";
import Menu from "../components/Menu";
import SpeakerSearchBar from "../components/SpeakerSearchBar";
import Speakers from "../components/Speakers";
import SpeakerContext from "../components/Speakers/SpeakerContext";

const speakers = [
    { src: "images/speaker-component-1124.png", name: "Douglas Crockford" },
    { src: "images/speaker-component-1530.png", name: "Tamara Baker" },
    { src: "images/speaker-component-10803.png", name: "Eugene Chuvyrov" },
];


const IndexPage = () => {
    return (
        <>
            <Header />
            <Menu />
            <SpeakerContext.Provider>
                <SpeakerSearchBar />
                <Speakers />
            </SpeakerContext.Provider>
            <Footer />
        </>
    );
};

export default IndexPage;
